import React, { Component } from "react";
import "../App.css";


const Home = (props) => {

    return (
      <div>
        <div className="tag">
          <button onClick={props.handleTag} value="top" className="button">
            Top
          </button>
          <button
            onClick={this.props.handleTag}
            value="bottom"
            className="button"
          >
            Bottom
          </button>
          <button onClick={this.props.handleTag} value="acc" className="button">
            Accessories
          </button>
          <button onClick={this.props.handleTag} value="all" className="button">
            All
          </button>
        </div>

        <div>{this.props.itemList}</div>
      </div>
    );
  }


export default Home;
